import React from 'react';

const mainDiv={
    height: '90vh',
    backgroundColor: '#00badb',
}

const mainTitle={
    fontSize: '42px',
    fontFamily: 'Roboto Mono',
    fontWeight: 400,
    paddingTop: '15rem',
}

const subHeading={
    fontSize: '2vw',
    fontFamily: 'Roboto Mono',
    fontWeight: 100,
    color: '#4d4d4d'
}

class LandingPage extends React.Component{
    render(){
        return(
            <div style={mainDiv}>
                <div style={mainTitle}>
                    Hi, I'm Paridhi!
                </div>
                <div style={subHeading}>
                    I develop websites and mobile apps. <br />
                    I also design :)
                </div>
            </div>
        );
    }
}

export default LandingPage;
